# 假设的行驶速度（km/h）
v_police = 60.0
v_criminal = 10.0  # 罪犯的速度（km/h）

# 计算时间 t 所对应的节点集合
def lambda1(t, v_criminal):
    result = set()
    for node, data in nodes.items():
        x = data[0]
        distance = x / 10  # 将百米转换为公里
        if distance / v_criminal <= t:
            result.add(node)
    return result

# 计算最小包围圈
def compute_convex_hull(points):
    if len(points) < 3:
        return list(range(len(points)))  # Convex hull is not defined for fewer than 3 points
    hull = ConvexHull(points)
    return hull.vertices

# 构建最大流二分查找模型
def build_max_flow_model(convex_hull_points, nodes, connections, t):
    G = nx.DiGraph()

    source = 's'
    sink = 't'

    # Add police nodes
    for node, data in nodes.items():
        if data[4] != 'nor':  # 如果不是普通节点，则认为是警察节点
            G.add_edge(source, node, capacity=1)

    # Add convex hull points and their connections
    for point in convex_hull_points:
        G.add_edge(point, sink, capacity=1)
        for conn in connections.get(point, []):
            conn_distance = conn[0] / 10  # 将百米转换为公里
            if conn[1] in convex_hull_points and conn_distance / v_police <= t:
                G.add_edge(conn[1], point, capacity=1)

    return G, source, sink

# 打印不同时间 t 对应的节点集合和最小包围圈
def find_optimal_block_time(v_criminal, v_police, nodes, connections, start_node):
    t = 1
    while t <= 600:
        lambda1_set = lambda1(t, v_criminal)
        if start_node not in lambda1_set:
            lambda1_set.add(start_node)
        points = np.array([nodes[node][:2] for node in lambda1_set])
        hull_indices = compute_convex_hull(points)
        hull_points = [list(lambda1_set)[i] for i in hull_indices]

        # Build and solve the max flow model
        G, source, sink = build_max_flow_model(hull_points, nodes, connections, t)
        flow_value, flow_dict = nx.maximum_flow(G, source, sink)

        print(f"时间 t = {t} 时，对应的节点集合 lambda1(t): {lambda1_set}")
        print(f"时间 t = {t} 时，对应的最小包围圈节点: {hull_points}")
        print(f"时间 t = {t} 时，最大流值: {flow_value}")

        if flow_value >= len(hull_points):
            print(f"找到最佳封锁时间: t = {t}")

            # 打印被选用的警局
            selected_police_stations = [node for node in flow_dict[source] if flow_dict[source][node] > 0]
            print(f"选用的警局: {selected_police_stations}")
            break

        t += 1

    if t > 600:
        print("小偷逃跑成功")

# 运行程序，指定逃跑起始节点为 '32'
find_optimal_block_time(v_criminal, v_police, nodes, connections, start_node='32')